import { useEffect, useContext } from "react"
import React from 'react'
import { Context } from "../Context"

export default function Tests() {
  const num = [{
    name: 'ГОВНО'
  },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },

  { name: 'МОЧА' },
  { name: 'МОЧА' },

  ]
  const { setCurrentPage } = useContext(Context)
  useEffect(() => setCurrentPage('/tests'), [])
  return (
    <div>
      <div class="select-wrapper">
        <select className="ApplicationContainer__Input" name="select" >
          {num.map(function (num) {
            return (<option className="ApplicationContainer__Input" >{num.name}</option>);
          })}
        </select>
        <div class="select-arrow-1"></div>
      </div>
    </div>
  )
}
